BlocklyGamesMsg["Pond.helpUseScan"] = "Ваша решења раде, али можете и боље. Користите 'scan' да бисте видели колико далеко пуцати из топа.";
BlocklyGamesMsg["Pond.helpText1"] = "Користите команду 'cannon' да бисте погодили мету. Први параметар је угао, други параметар је домет. Откријте праву комбинацију.";
