BlocklyGamesMsg["Pond.helpText5"] = "Овај противник је такође предалеко да би се користио топ. Али Ви сте преслаби да преживите судар. Пливајте према противнику док Вам је хоризонтална локација мања од 50. Потом користите 'stop' и употребите топ.";
BlocklyGamesMsg["Pond.helpText6"] = "Овај противник ће се удаљити када је погођен. Пливајте према њему ако је ван домета (70 метара).";
